import { useState } from 'react'

function TabellineLog() {

    const [results, setResults]=useState([1,2,3])
    const handleSubmit=(event)=>{
        event.preventDefault()
        alert('hey')
    } 
    const displayLog = ()=>{

        results.map((r)=>(<p>r</p>))
    }   
    return (<div><h1>TABELLINE</h1>
     <form onSubmit={handleSubmit}>
                    <input type="text"/>
                    <button>ok</button>
    </form>
    <div className="tabelline-log">
        xx{displayLog()}
    </div>

    </div>)
}


export default TabellineLog
